import Compose from "./Compose";
import { NavLink } from "react-router-dom";
import { Context } from "./Mycontext";

export const Sauces = () => {
  const { nextTacos } = useContext(Context);
  return (
    <div className=" relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <Compose />
      <NavLink to="/extra">
        <span className=" p-9 text-7xl" onClick={() => nextTacos(4)}>
          &#10093;
        </span>
      </NavLink>
    </div>
  );
};

export const Extra = () => {
  const { nextTacos } = useContext(Context);
  return (
    <div className=" relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <Compose />
      <NavLink to="/sauces">
        <span className=" p-9 text-7xl" onClick={() => nextTacos(4)}>
          &#10093;
        </span>
      </NavLink>
    </div>
  );
};
